import React from 'react';

function Contact() {
  return (
    <section id="contact" style={{ marginLeft: "10px"}}>
      <h2 style={{ display: "flex", alignItems: "center", flexDirection: "column", color: '#00afb9', fontSize: '30px' }}>Contact Me</h2>
      <form>
      <div style={{ display: "flex", alignItems: "center", flexDirection: "column" }}>
        <label htmlFor="name">Name</label>
        <input type="text" id="name" style={{ padding: "8px", margin: "8px 0", borderRadius: "5px", border: "1px solid #ccc" }} />
        <label htmlFor="email">Email</label>
        <input type="email" id="email" style={{ padding: "8px", margin: "8px 0", borderRadius: "5px", border: "1px solid #ccc" }} />
        <label htmlFor="message">Message</label>
        <textarea id="message" style={{ padding: "8px", margin: "8px 0", borderRadius: "5px", border: "1px solid #ccc" }}></textarea>
        <button type="submit" style={{ padding: "8px", margin: "8px 0", borderRadius: "5px", backgroundColor: "#27ae60", color: "white", border: "none" }}>Submit</button>
      </div>
    </form>
    </section>
  );
}

export default Contact;
